    [],nt"num_tags": 5,nt"name": "national-bison-range-refuge-narrative-report-september-1-to-december-31-1949",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for National Bison
    Range outlines Refuge accomplishments from September through December of 1949. The
    report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, and mammals- is also covered. The Refuge development
    and maintenance section discusses physical developments. The public relations section
    of the report describes recreational uses, Refuge visitors, and Refuge participation.
    Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
